  false,\n\t\"url\": null,\n\t\"notes\": \"Over the years, fish and wildlife habitat
  in the Great Lakes basin has been dramatically altered by many factors including
  water level regulation, the introduction of exotic species and point and non-point
  source pollution. Efforts to restore and rehabilitate habitat are on the rise with
  numerous projects underway around the basin. While every project is unique, each
  addressing a different combination of impacts, many of the stresses on habitat are
  common and widespread. There is an opportunity to gain valuable insight into various
  habitat rehabilitation techniques by examining the success and failure of projects
  with similar impacts.One of these common and widespread stresses, particularly in
  coastal areas, is carp (Cyprinus carpio). Carp are known to displace emergent and
  submergent vegetation through feeding, rooting and spawning. If carp are a problem
  at a rehabilitation site, carp control or exclusion is necessary to protect aquatic
  vegetation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
